feat: implement datafusion tableprovider trait for `Dataset` (#1526)

This allows better native integrations with datafusion.
closes https://github.com/lancedb/lance/issues/1520

### Example

```rust
use std::sync::Arc;

use datafusion::prelude::*;
use lance::Dataset;

#[tokio::main]
async fn main() -> datafusion::error::Result<()> {
    let path = "./.lancedb/my_table.lance";

    let dataset = Dataset::open(path).await.unwrap();
    let ctx = SessionContext::new();
    ctx.register_table("my_table", Arc::new(dataset)).unwrap();
    let df = ctx
        .sql("SELECT * FROM my_table where lat = 45.5")
        .await
        .unwrap();

    df.show().await?;
    Ok(())
}
```

